import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';

const Navbar = () => {
  const [showProductDropdown, setShowProductDropdown] = useState(false);
  const navigate = useNavigate();



  const handleLogout = () => {
    sessionStorage.clear();
    navigate('/login');
  };

  const styles = {
    navbar: {
      background: '#2a2a2a',
      padding: '15px 30px',
      display: 'flex',
      justifyContent: 'space-between',
      alignItems: 'center',
      position: 'fixed',
      top: 0,
      width: '100%',
      zIndex: 1000,
      boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
    },
    navLinks: {
      display: 'flex',
      alignItems: 'center',
      gap: '16px',
    },
    navLink: {
      color: 'white',
      textDecoration: 'none',
      padding: '10px 20px',
      borderRadius: '25px',
      fontWeight: 'bold',
      transition: 'all 0.3s ease',
      background: 'rgba(255, 255, 255, 0.1)',
      cursor: 'pointer',
    },
    dropdownMenu: {
      position: 'absolute',
      top: '50px',
      left: 0,
      backgroundColor: 'rgba(255, 255, 255, 0.95)',
      borderRadius: '8px',
      padding: '10px 15px',
      zIndex: 1,
      boxShadow: '0px 4px 12px rgba(0,0,0,0.15)',
    },
    dropdownItem: {
      color: '#333',
      padding: '10px 15px',
      textDecoration: 'none',
      display: 'block',
      backgroundColor: '#f5f5f5',
      margin: '5px 0',
      borderRadius: '4px',
      transition: 'background-color 0.3s ease',
      cursor: 'pointer',
    },
    logo: {
      color: 'white',
      fontSize: '25px',
      fontWeight: 'bold',
      textDecoration: 'none',
    },
    welcomeText: {
      color: 'white',
      fontSize: '16px',
      marginRight: '45px',
      cursor: 'pointer', 
    },
  };

  return (
    <header style={styles.navbar}>
      <Link to="/User" style={styles.logo}>
        Online Medical Shop user
      </Link>
      <nav style={styles.navLinks}>
        <div style={styles.navLink} onClick={() => navigate('#')}>
          View Bookings
        </div>
        <div style={styles.navLink} onClick={() => navigate('/ChangePassword')}>
          Change Password
        </div>
        <span style={styles.welcomeText} onClick={handleLogout}>
          <i className="bi bi-person-circle"></i> Wellcome,{' '}
          {sessionStorage.getItem('name')}
        </span>
      </nav>
    </header>
  );
};

export default Navbar;
